00094 template<typename T>
00095 void UserVariables::addVariable(std::string name, T value) {
00096     variables[name] = new T(value);
00097 }
00098 
00099 template<typename T>
00100 T UserVariables::getValue(std::string name) {
00101     auto it = variables.find(name);
00102     if (it != variables.end()) {
00103         return *static_cast<T*>(it->second);
00104     }
00105     return T();
00106 }
